import React, { Component, Fragment } from "react";
import ReactDOM from "react-dom";

class HomeSlider extends Component{
    render(){
        return(
           <Fragment>
               <div>
                   <h1>This is My  First Slider.</h1>
                   <p>Hello slider I am happy.</p>
               </div>
           </Fragment>
        )
    }
}
ReactDOM.render(<HomeSlider />, document.getElementById("roott"));
export default HomeSlider;
